import React from 'react';

const Navbar = ({ currentPlaylist }) => {
  return (
    <nav className="bg-darkGray p-4">
      <div className="container mx-auto flex justify-between items-center">
        <a href="/" className="text-teal text-xl font-bold">Spotify Top Songs</a>
        <div>
          <span className="text-white mr-4">Current Playlist: {currentPlaylist}</span>
          <button className="bg-teal hover:bg-hoverGray text-white font-bold py-2 px-4 rounded">
            Add Music
          </button>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
